import './App.css';

function App() {

  //let langitude = document.getElementById('langitudeInput').value
  let longitude;
  //console.log(langitude);
  console.log(longitude);

  var form = document.querySelector("form");
  console.log(form);

  async function getFormData(){
    // SEND POST AND GET RESPONSE
    let response = await fetch('/url')
    .then(response => response.json())
    .then(data => console.log(data))
    .catch(err => console.error(err));
  }

  getFormData();



  async function apiCall() {
    let URI = 'http://history.openweathermap.org/data/2.5/history/city?lat={lat}&lon={lon}&type=hour&start={start}&end={end}&appid={API key}'
    let response = await fetch(URI)
    .then(response => response.json())
    .then(data => console.log(data))
    .catch(err => console.error(err));
  }

  apiCall();


  return (
    <div className="App">
      <header className="App-header">
        Sunrise Avenue Solar Energy Production Forecast!
        <img src={logo} className="App-logo" alt="logo" />
        <form action="/url" method="GET">
          <p>Please enter longitude and latitude of your location</p>
          <input type="text" name="Langitude" placeholder="Langitude" id="langitude" required></input>
          <br></br>
          <input type="text" name="Longitude" placeholder="Longitude" required></input>
          <br></br>
          <button type="submit">Submit</button>  
        </form>
      </header>
      <body>
        <p>
          AI Venture Project Livia Fries, Anne-Sophie Hannes, Philip Nag and Antonious Strauch 
        </p>
      </body>
    </div>
  );
}

export default App;
